function lydist(e){
  let m = prompt("enter a number < 251 or 0 to clear: ","");
  if(m && m.match(/^\d{1,3}$/) && m < 251){ // canceled?
    if(Number(m) > 0){
      e.className = "lyn";
      e.innerHTML = m.padStart(3,'0');
    }else{
      e.className = "ly0";
      e.innerHTML = "LY";
    }
    // console.log(`${kv(e.parentNode.parentNode)}`);
    asyncPostCall(e);
} }

function pcnt(e){
  let m = prompt("enter a number < 7 or 0 to clear: ","");
  if(m && m.match(/^\d$/) && m < 7){ // canceled?
    if(m > 0){
      e.className = "pn";
      e.innerHTML = m;
    }else{
      e.className = "p0";
      e.innerHTML = "P";
    }
    // console.log(`${kv(e.parentNode.parentNode)}`);
    asyncPostCall(e);
} }

function coord(){
  let m = prompt("enter 2 digits, each between 0 and 7: ","");
  if(m && (m.match(/^[0-7][0-7]$/) || m == '99')) { // canceled?
    let n =  m.split('').map(function(n){
        return parseInt(n).toString(2).padStart(3,'0');
      }).join(' ');
    if(m == '99'){
      n = m;
    }else{
      localStorage.setItem('github', n);
    }
    asyncGetCall(n);
} }

